import React from 'react';
import RegistrationForm from "../components/RegistrationForm";

function Register() {
    return (
        <div className="container my-4">
            <div className="col-md-12 d-flex align-items-center flex-column">
                <RegistrationForm/>
            </div>
        </div>
    );
}

export default Register;
